	add("acronym", "{\"term\":\"acronym\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{confix|acro|onym|lang\u003den}}, first attested around 1940. \u0026lt;!--\u0027acro-\u0027 means \u0026quot;tip end, beginning\u0026quot; and \u0027-onym\u0027 means \u0026quot;name\u0026quot;. The term was modelled after \u0027\u0027 and \u0027\u0027 and the parts are ultimately derived from \u0027ἄκρος\u0027 (extremity) and \u0027ὄνομα\u0027 (name) --\u0026gt;From Ancient greek (to 1453) \u0027ἄκρος\u0027 (tip)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abbreviation formed by (usually initial) letters taken from a word or series of words, that is itself pronounced as a word, such as \u0027RAM\u0027, \u0027radar\u0027, or \u0027scuba\u0027; sometimes contrasted with initialism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, A teacher, \u0026quot;[http://www.theguardian.com/education/2014/sep/23/choosing-primary-school-guide-teachers-guide-for-parents Choosing a primary school: a teacher\u0027s guide for parents]\u0026quot;, \u0027The Guardian\u0027, 23 September 2014\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some teachers festoon every spare inch of wall with vocabulary choices or maths techniques to use, which look great at first, but to some children might appear quite daunting. You\u0027ll probably see unfamiliar \u0027\u0027acronyms\u0027\u0027 such as Walt (We Are Learning To). Be sure to ask what they stand for and how they are used in practice\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A pronounceable word formed from the beginnings (letter or syllable) of other words and thus representing the phrase so formed, e.g. Benelux \u003d the countries Belgium, Netherlands and Luxembourg considered as a political or economic whole\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any abbreviation so formed, regardless of pronunciation, such as \u0027TNT, BBC, IBM\u0027, or \u0027XML\u0027 (see usage notes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d6|page\u003d18|magazine\u003d|title\u003d[http://www.theguardian.com/commentisfree/2013/jul/10/geopolitics-transatlantic-trade-deal Where Dr Pangloss meets passage\u003dHidden behind thickets of \u0027\u0027acronyms\u0027\u0027 and gorse bushes of detail, a new great game is under way across the globe. Some call it geoeconomics, but it\u0027s geopolitics too. The current power play consists of an extraordinary range of countries simultaneously sitting down to negotiate big free trade and investment agreements\", \"priority\":6}]}, \"synonyms\":{}}");

	add("acronymania", "{\"term\":\"acronymania\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|acronym|mania|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The enthusiastic creation and use of acronyms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Ashton B. Carter, ‎William James Perry, \u0027Preventive Defense: A New Security Strategy for America\u0027 (page 21\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the Pentagon\u0027s \u0026quot;\u0027\u0027acronymania\u0027\u0027,\u0026quot; the plane\u0027s official name, the National Emergency Airborne Command Post — NEACP, pronounced \u0026quot;kneecap\u0026quot; — had been changed to NAOP, National Airborne Operations Center\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Richard Stern, \u0027What Is What Was\u0027 (page 196\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Some of that mastodon meat is in the essays—tennis, teens, television—and some of its manner, too—foot-notery, abbreviations, \u0027\u0027acronymania\", \"priority\":5}]}, \"synonyms\":{}}");

