	add("acropoleis", "{\"term\":\"acropoleis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀκροπόλεις\u0027 () plural of \u0027ἀκρόπολις\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1852\u0027\u0027: Barthold Georg Neibuhr, \u0027Lectures on Ancient History: From the Earliest Times to the Taking of Alexandria by Octavianus. Comprising the History of the Asiatic nations, the Egyptians, Greeks, Macedonians and Carthaginians\u0027, p35\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Cadmea, like almost all Greek \u0027\u0027acropoleis\u0027\u0027, was indeed surrounded by the city, and was situated within the walls; but from our historians, it is quite evident, that one side of the Cadmea touched upon the wall of the city, and upon this supposition alone the siege can be understood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027: The Managing Committee of the British School at Athens, \u0027The Annual of the British School at Athens\u0027, p8\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The\u0027 ἀγορά \u0027mentioned by Thucydides\u0027. — I have already referred to the view that the saddle between the two \u0027\u0027Acropoleis\u0027\u0027 was the site of the … and the most probable site for the agora is the level tract which lies between the two \u0027\u0027Acropoleis\u0027\u0027, and if this be so, continues some way towards the gate\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1937\u0027\u0027: Peabody Museum of Archaeology and Ethnology, \u0027Memoirs of the Peabody Museum of Archaeology and Ethnology, Harvard University\u0027, p9\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"There are three great \u0027\u0027acropoleis\u0027\u0027, great natural hills levelled off\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: Walter Horatio Pater, \u0027Greek Studies a Series of Essays\u0027, p10\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"…the tyrants’ age, the age of the \u0027\u0027acropoleis\u0027\u0027, the period of great dynasties with claims to “divine right”\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: William Hutton, \u0027Describing Greece: Landscape and Literature in the Periegesis of Pausanias\u0027, p13\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"At Megara, a city which has the unusual distinction of possessing two \u0027\u0027acropoleis\u0027\u0027 (see Figure 1.3), both of the \u0027\u0027acropoleis\u0027\u0027 serve as foci for Pausanias’ description: the description begins at the fountain house of Theagenes, proceeds to the eastern acropolis (Karia), and then descends from that acropolis toward the north (1.40.1–41.8\", \"priority\":10}]}, \"synonyms\":{}}");

